const About = () => {
    return (
        <div className="about-container">

            <div className="About-images" id="about-img">
              

               <img className="bg-about-img" id="aboutB" alt='' src= { cliff } />
               <img className="bg-about-img" id="aboutF" alt='' src= { legShot } />

