                <img className="bg-about-img" id="aboutC" alt='' src= { concert } />
                <img className="bg-about-img" id="aboutE" alt='' src= { eatout } /> 
            </div>
              
            </div>
            
                <div className="About-bg-text">
                  <h4 className="center" id="aboutTitle">About</h4>
                     <p> WelcomeWe love Cincinnati and want to share the best of it with you. We live, work and play here. Our mission is connecting you to the sights, sounds, and events in our city. 
                      Weâ€™d love to connect with you on social media. Share your experience with us on Facebook, or connect with us on our contact page. Thank you for visiting our city, and we hope you enjoy your visit.</p>
                </div>
                     
        </div>
    )
};
export default About;
